import React from "react";

const MenuCard = ({ menuData }) => {
  return (
    <>
<section className="main-card--cointainer">
      {menuData.map((curr) => {
          const {id ,image,name,category,price,description}=curr;
        return (
          <>
            <div className="card-container">
              <div className="card">
                <div className="card-body">
                  <span className="card-number card-circle subtel">{id}</span>
                  <span className="card-author subtel">{category}</span>
                  <h2 className="card-title">{name}</h2>
                  <span className="card-description subtel">
                    {description}
                  </span>
                  <div className="card-read">Read</div>
                </div>
                <img src={image} alt="images" className="card-media"/>
               <br/> <span><h2>Price :</h2><h2 className>{price}</h2></span>
               <br/> <span className="card-tag subtel">Order Now</span>
              </div>
            </div>
          </>
        );
      })}
      </section>
    </>
  );
};

export default MenuCard;
